  false,\n\t\"url\": null,\n\t\"notes\": \"U.S. collision regulation boundaries are
  lines of demarcation delineating those waters upon which mariners shall comply with
  the International Regulations for Preventing Collisions at Sea, 1972 (72 COLREGS)
  and those waters upon which mariners shall comply with the Inland Navigation Rules.
  The waters inland of these lines are subject to the Inland Navigation Rules Act
  of 1980. The waters outside these lines are subject to the International Navigation
  Rules of the International Regulations for Preventing Collisions at Sea, 1972 (COLREGS).
  The Coast Guard has the legal authority to effect regulatory changes to COLREGS.
  Creation of features was interpreted from descriptions published in the Code of
  Federal Regulations Title 33, Part 80.\",\n\t\"license_title\": null,\n\t\"extras\":
